import React, { Component } from 'react';
import { Layout } from 'antd';
const {
    Header, Footer, Sider, Content,
} = Layout;


class Message extends Component {

    render() {
        return (
            <Layout>
            <Header>
            </Header>,

            <Content>
            </Content>,

            <Footer>
            </Footer>

            </Layout>
        );
    }
}
export default Message;
